import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";

function Login() {
  return (
    <div>
      <h1 style={{ color: "#004cff", fontSize: "100px" }}>인뱅</h1>
      <h2 style={{ color: "#004cff" }}>In-Bang</h2>

      <div
        style={{
          backgroundColor: "#1200b8",
          padding: "20px",
          color: "white",
          width: "200px",
          margin: "auto",
          position: "relative",
        }}
      >
        <Link
          to="/"
          style={{
            position: "absolute",
            right: "10px",
            top: "10px",
            color: "#ffffff",
          }}
        >
          X
        </Link>
        <p style={{ color: "#000000" }}>Welcome!</p>
        <label>
          Username:
          <input type="text" name="username" />
        </label>
        <br />
        <label>
          Password:
          <input type="password" name="password" />
        </label>
        <br />
        <button>Login</button>
        <p style={{ color: "#000000" }}>Don't have an account? Click below.</p>
        <Link to="/registration" style={{ color: "#000000" }}>
          Register
        </Link>
      </div>
    </div>
  );
}

export default Login;
